(1, 'Tại sao Bình đẹp trai đến thế ?', 'Vì Bình thích', 'Do tạo hoá đã muốn bình đẹp', 'Do những kết tinh đẹp nhất đã hội tụ vào Bình', 'Cả ba ý trên đều đúng', 'D', 'de', 1, '2019-12-14 06:31:49', '2019-12-14 06:31:49'),
(2, 'cc', 'cccccccccc', 'ccc', 'cccccccc', 'cccccccccccccccccc', 'A', 'de', 1, '2019-12-14 06:59:43', '2019-12-14 06:59:43'),
(3, 'Bình', 'Quỳnh', 'Quỳnh', 'Quỳnh', 'Quỳnhh', 'D', 'kho', 1, '2019-12-19 06:27:32', '2019-12-19 06:27:32'),
