(5, 'Đáp án của phép tính -5/12 + (-1)/4 là :', '-6/12', '-8/12', '8/12', '6/12', 'B', 'de', 3, '2019-12-21 09:18:09', '2019-12-21 09:18:09'),
(6, 'Biết rằng -3/4 = x/5. Giá trị của x bằng :', '-20/3', '-15/4', '2', '-2', 'B', 'de', 3, '2019-12-21 09:19:06', '2019-12-21 09:19:06'),
(7, 'Giá trị của biểu thức M = (3 - 2,5) - [5 - (-1,5)]+1/2+9-3*3 là:', '-5.5', '3', '-4.5', '-3.5', 'A', 'tb', 3, '2019-12-21 09:19:52', '2019-12-21 09:19:52'),
(8, 'Cho một đường thẳng cắt hai đường thẳng song song. Khi đó số cặp góc đồng vị bằng nhau được tạo thành là :', '2', '6', '8', '4', 'D', 'tb', 3, '2019-12-21 09:20:59', '2019-12-21 09:20:59'),
(9, 'Cho hàm số y = f(x) = -2x + 1. Khẳng định nào sau đây là đúng:', 'f(-1) = 3', 'f(0) = 1', 'f(1/2) = 1', 'f(2) = 1/3', 'B', 'de', 3, '2019-12-21 09:21:37', '2019-12-21 09:21:37'),
(10, 'Phân số viết được dưới dạng số thập phân vô hạn tuần hoàn là:', '3/8', '1/2', '-7/5', '10/3', 'D', 'de', 3, '2019-12-21 09:25:02', '2019-12-21 09:25:02'),
(11, 'Nếu một đường thẳng cắt hai đường thẳng song song thì hai góc so le trong:', 'bằng nhau', 'Bù nhau', 'Kề nhau', 'Kề bù.', 'A', 'de', 3, '2019-12-21 09:25:32', '2019-12-21 09:25:32'),
(12, 'Đề: https://i.imgur.com/lwqCZHu.png', 'HI = NP', 'IK = MN', 'HK = MP', 'HI = MN', 'D', 'tb', 3, '2019-12-21 09:29:25', '2019-12-21 09:29:25'),
(13, 'Đề: https://i.imgur.com/uYoL27X.png', '60 độ', '30 độ', '90 độ', '120 độ', 'A', 'de', 3, '2019-12-21 09:34:47', '2019-12-21 09:34:47'),
(14, 'Đề: https://i.imgur.com/5qYXTl2.png', '11/24', '22/48', '-11/24', '-22/48', 'A', 'de', 3, '2019-12-21 09:36:51', '2019-12-21 09:36:51'),
(15, 'Đề: https://i.imgur.com/Y3m36ZX.png', '-3/12', '-1/4', '1/4', '3/12', 'B', 'de', 3, '2019-12-21 09:38:21', '2019-12-21 09:38:21'),
(16, 'Đề: https://i.imgur.com/4wXfNNs.png', '2/5', '-2/5', '2/5 hoặc -2/5', '1 hoặc 2/5', 'C', 'de', 3, '2019-12-21 09:39:41', '2019-12-21 09:39:41'),
(17, 'Đề: https://i.imgur.com/Ih2mAbi.png', 'AB = DE', 'Góc C = Góc E', 'Góc B = Góc E', 'BC = EF', 'B', 'de', 3, '2019-12-21 09:42:45', '2019-12-21 09:42:45'),
(18, 'Tìm x : |x - 1,5| = 2', 'x = 3,5', 'x = - 0,5', 'x = 3,5 hoặc -0.5', 'x = -3,5 hoặc 0.5', 'C', 'de', 3, '2019-12-21 09:44:11', '2019-12-21 09:44:11'),
(19, 'GTLN của biểu thức |x - 1004| - |x + 1003|', '2007', '1004', '4005', '-1', 'A', 'kho', 3, '2019-12-21 09:45:56', '2019-12-21 09:45:56'),
(20, 'Ba bạn Bình, Bảo, Mẹ có tất cả 60 cây bút và có tỉ lệ là 3:4:5. Tìm số bút mỗi bạn', 'Số bút của 3 bạn lần lượt là: 15, 20, 25', 'Số bút của 3 bạn lần lượt là: 10, 25, 20', 'Số bút của 3 bạn lần lượt là: 25, 20,10', 'Số bút của 3 bạn lần lượt là: 25, 15, 20', 'A', 'de', 3, '2019-12-21 09:51:07', '2019-12-21 09:51:07'),
(21, 'Đề :  https://i.imgur.com/6haVVgv.png', 'D1, C2, C3, B4 = 61, 100, 80, 100', 'D1, C2, C3, B4 = 100, 80, 100,61', 'D1, C2, C3, B4 = 61, 80, 100, 100', 'D1, C2, C3, B4 = 80, 100, 61, 100', 'A', 'de', 3, '2019-12-21 09:54:27', '2019-12-21 09:54:27'),
(22, 'Bảo mua 10 cây bút.Bảo cho Bạn mượn 3 cây bút, hôm sau bạn trả lại cho Bảo 5 cây. Mẹ cho Bảo thêm 20 cây bút nữa. Vì quá mê game nên Bảo đổi 10 cây bút thành tiền đề đi chơi net.  Hỏi hôm nay Bảo còn dư bao nhiêu cây viết', '17', '25', '22', '15', 'A', 'tb', 3, '2019-12-21 09:58:31', '2019-12-21 09:58:31'),
