(550, 'Đọc thầm bài tập đọc “Mẩu giấy vụn” - Sách Tiếng Việt lớp 2, tập 1 trang 48 và trả lời các câu hỏi sau : \"Lớp học của các bạn nhỏ trong câu chuyện trông như thế nào?\"', 'Trông rất bừa bãi.', 'Rất rộng rãi, sáng sủa và sạch sẽ.', 'Rất rộng rãi, sáng sủa và sạch sẽ nhưng có một mẩu giấy vụn ngay giữa cửa ra vào.', 'Trông rất lộn xộn.', 'C', 'de', 21, '2020-03-06 03:36:53', '2020-03-06 03:36:53'),
(551, 'Ai là người đã nói với cô giáo rằng mẩu giấy không biết nói?', 'Một bạn nam', 'Bạn lớp phó', 'Bạn lớp trưởng', 'Một bạn nữ', 'A', 'de', 21, '2020-03-06 03:44:02', '2020-03-06 03:44:02'),
(552, 'Bạn gái ấy nghe thấy mẩu giấy nói điều gì ?', '“Các bạn hãy nhặt tôi lên đi !”', '“Các bạn đừng vứt rác bừa bãi nhé !”', '“Các bạn ơi ! Hãy bỏ tôi vào sọt rác !”', '“Các bạn hãy giữ gìn lớp học sạch sẽ nhé !”', 'C', 'de', 21, '2020-03-06 03:46:50', '2020-03-06 03:46:50'),
(553, 'Cô giáo yêu cầu cả lớp làm gì ?', 'Lắng nghe xem mẩu giấy nói gì.', 'Nhặt mẩu giấy bỏ vào sọt rác.', 'Lấy sách giáo khoa để học bài.', 'Mở vở ra viết bài.', 'A', 'tb', 21, '2020-03-06 03:48:34', '2020-03-06 03:48:34'),
(554, 'Qua bài tập đọc này, em hiểu ý cô giáo muốn nhắc nhở học sinh điều gì ?', 'Phải biết giữ gìn vệ sinh lớp học để lớp luôn sạch đẹp.', 'Mẩu giấy cũng biết trò chuyện.', 'Phải biết lắng nghe những thứ xung quanh ta.', 'Phải giữ im lặng khi cô bước vào lớp.', 'A', 'kho', 21, '2020-03-06 03:53:32', '2020-03-06 03:53:32'),
(555, 'Đọc bài tập đọc \"Bạn của Nai Nhỏ - Sách Tiếng Việt lớp 2 tập 1, trang 22 và trả lời các câu hỏi sau : \"Nai Nhỏ xin phép cha đi đâu ?\"', 'Đi chơi xa cùng bạn.', 'Đi chơi xa một mình.', 'Đi ra bờ sông uống nước.', 'Đi chơi xa cùng với Hổ và Sói.', 'A', 'de', 21, '2020-03-06 03:58:41', '2020-03-06 03:58:41'),
(556, 'Trước khi đồng ý cho con đi chơi, cha Nai Nhỏ đã yêu cầu Nai Nhỏ làm gì ?', 'Muốn Nai Nhỏ và bạn phải về đúng giờ.', 'Muốn Nai Nhỏ dẫn bạn đến gặp cha.', 'Muốn Nai Nhỏ và bạn không được đi chơi quá xa.', 'Muốn Nai Nhỏ kể cho cha nghe về người bạn của mình.', 'D', 'de', 21, '2020-03-06 04:01:18', '2020-03-06 04:01:18'),
(557, 'Vì sao cha Nai Nhỏ lại lo lắng cho bạn ấy ?', 'Vì cha Nai Nhỏ không thích bạn của Nai Nhỏ.', 'Vì bạn của Nai Nhỏ không tốt.', 'Vì Nai Nhỏ còn bé và cha của Nai Nhỏ chưa biết bạn của Nai Nhỏ là người như thế nào.', 'Vì Nai Nhỏ chưa đi chơi xa lần nào.', 'C', 'tb', 21, '2020-03-06 04:02:41', '2020-03-06 04:02:41'),
(558, 'Bạn của Nai Nhỏ đã làm gì để giúp đỡ Dê Non thoát khỏi nguy hiểm ?', 'Kéo Dê Non chạy một mạch vào rừng.', 'Đánh lạc hướng Sói.', 'Dùng đôi gạc chắc khỏe húc Sói ngã ngửa.', 'Ra hiệu cho Dê Non nấp sau bụi cây.', 'C', 'de', 21, '2020-03-06 04:04:19', '2020-03-06 04:04:19'),
(559, 'Qua những hành động của bạn Nai Nhỏ, cho em thấy bạn của Nai Nhỏ là một con vật như thế nào ?', 'Thông minh, nhanh nhẹn, khỏe mạnh, dũng cảm.', 'Không biết giúp đỡ bạn.', 'Hung dữ.', 'Yếu ớt.', 'A', 'tb', 21, '2020-03-06 04:07:56', '2020-03-06 04:07:56'),
(560, 'Vì sao cha Nai Nhỏ đồng ý cho bạn ấy đi chơi xa ?', 'Vì cha Nai Nhỏ rất yêu quý Nai Nhỏ.', 'Vì Nai Nhỏ có một người bạn vừa dũng cảm, vừa tốt bụng lại sẵn sàng giúp bạn và cứu bạn khi cần thiết.', 'Vì bạn của Nai Nhỏ rất khỏe.', 'Vì Nai Nhỏ thông minh.', 'B', 'tb', 21, '2020-03-06 04:09:55', '2020-03-06 04:09:55'),
(561, 'Theo em, người bạn tốt là người như thế nào ?', 'Là người luôn sẵn sàng giúp đỡ bạn trong mọi hoàn cảnh.', 'Là người thông minh.', 'Là người khỏe mạnh.', 'Là người dũng cảm.', 'A', 'kho', 21, '2020-03-06 04:21:48', '2020-03-06 04:21:48'),
(562, 'Đọc thầm bài tập đọc \"Bông hoa Niềm Vui - sách Tiếng Việt lớp 2, tập 1, trang 104\" và trả lời các câu hỏi sau : \"Bạn nhỏ trong câu chuyện này có tên là gì?\"', 'Lan', 'Chi', 'Mai', 'Hoa', 'B', 'de', 21, '2020-03-06 04:25:04', '2020-03-06 04:25:04'),
(563, 'Bông hoa cúc trong vườn trường được các bạn gọi tên là gì ?', 'Bông hoa Niềm Vui.', 'Bông hoa Hạnh Phúc.', 'Bông hoa May Mắn.', 'Bông hoa Đặc biệt.', 'A', 'de', 21, '2020-03-06 04:26:21', '2020-03-06 04:26:21'),
(564, 'Vì sao Chi không dám tự ý hái bông hoa Niềm Vui ?', 'Vì theo nội quy của trường không ai được ngắt hoa trong vườn.', 'Vì Chi sợ cô giáo phạt.', 'Vì Chi sợ bác bảo vệ.', 'Vì Chi sợ các bạn nhìn thấy sẽ mách cô.', 'A', 'tb', 21, '2020-03-06 04:27:42', '2020-03-06 04:27:42'),
(565, 'Chi tìm đến những bông hoa Niềm Vui để làm gì?', 'Để em cảm thấy vui vẻ, yêu đời hơn.', 'Để hái bông hoa Niềm Vui đem vào bệnh viện tặng bố, làm dịu cơn đau của bố.', 'Để ngắm nhìn và chăm sóc cho những khóm hoa lộng lẫy ấy.', 'Để hái bông hoa Niềm Vui đem tặng bạn.', 'B', 'de', 21, '2020-03-06 04:29:28', '2020-03-06 04:29:28'),
(566, 'Vì sao cô giáo không phạt Chi ?', 'Vì Chi là con gái.', 'Vì cô giáo yêu quý Chi.', 'Vì Chi rất dễ thương.', 'Vì cô giáo hiểu được lí do tại sao Chi cần bông hoa Niềm Vui.', 'D', 'tb', 21, '2020-03-06 04:30:38', '2020-03-06 04:30:38'),
